import React from 'react';
import { Homepage } from './components/Homepage';
import './App.scss';
import { BrowserRouter as Router, Route, Switch} from "react-router-dom";
import { CarList } from './components/CarList';

function App() {
  return (
    <Router>
    <div className="App">
      <section>
        {/* <img src="./photos/brand.png" alt="brand logo" className="brand-logo" /> */}
        <Switch>
          <Route exact path="/">
            <Homepage />
          </Route>
          <Route exact path="/car-list">
            <CarList />
          </Route>
        </Switch>
      </section>
    </div>
    </Router>
  );
}

export default App;
